import React from "react";
import "./App.css";
import { Box, Button } from "@mui/material";
import Home from "./pages/home/Home";
function App() {
  return (
    <div className="App">
      <div
        className="blur"
        style={{
          top: "-20%",
          right: "0",
        }}
      ></div>
      <div
        className="blur"
        style={{
          top: "15%",
          left: "-15%",
        }}
      ></div>
      <Home />
    </div>
  );
}

export default App;
